CREATE DATABASE Accounts
GO

USE Accounts 



CREATE TABLE Accounts (
	AccountNo CHAR(12),
	Name VARCHAR(50),	
	NRIC CHAR(9),
	Contact VARCHAR(20),
	PinNumber CHAR(6),
	AccountBalance MONEY,
	WithdrawalLimit MONEY,
	TransferLimit MONEY

	,CONSTRAINT PK_Accounts PRIMARY KEY(AccountNo)
);

CREATE TABLE Transactions (
	SourceAccount CHAR(12),
	TargetAccount CHAR(12)

	,CONSTRAINT PK_Transactions PRIMARY KEY(SourceAccount)
);